pragma solidity ^0.5.0;

import "./Patient.sol";
import "./DataRequester.sol";
import "./DataCreator.sol";
import "./OracleService.sol";
import "./DataProfile.sol";

contract Registration {
    mapping(address => DataRequesterList) public drl;
    mapping(address => DataCreatorList) public dcl;
    mapping(address => PatientList) public pl;

    DataCreator public dc;
    DataRequester public dr;
    Patient public p;
    OracleService public os;
    DataProfile public dp;

    address public owner;
    address public contractAddress;

    struct PatientList {
        address walletAddress;
        address contractAddress;
        bool approved;
    }

    struct DataCreatorList {
        address walletAddress;
        address contractAddress;
        bytes oracleServiceServer;
        bool approved;
    }

    struct DataRequesterList {
        address walletAddress;
        address contractAddress;
        bytes publicKeyIpfsRef;
        bytes32 role;
        bool approved;
    }

    event setDataRequesterInfoLog(
        address indexed _dataRequestorContractAddress,
        address indexed _dataRequesterWalletAddress,
        bytes _publicKeyIpfsRef,
        bytes32 _role
    );

    event setPatientInfoLog(
        address indexed _patientContractAddress,
        address indexed _patientWalletAddress
    );

    event setDataCreatorInfoLog(
        address indexed _dataCreatorContractAddress,
        address indexed _dataCreatorWalletAddress,
        bytes _oracleServiceServer,
        address thiscontract
    );

    event setupSystemContractsLog(address OracleService, address DataProfile);

    event updateDataRequesterPublicKeyLog(bytes _publicKeyIpfsRef);

    event updateOracleServiceServerLog(bytes _oracleServiceServer);

    event approveDataCreatorLog(address indexed _contract, bool _approved);

    event approvePatientLog(address indexed _contract, bool _approved);

    event approveDataRequesterLog(address indexed _contract, bool _approved);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only admin can call this function");
        _;
    }

    constructor() public {
        owner = msg.sender;
        contractAddress = address(this);
    }

    function approveDataCreator(address _dc) public onlyOwner {
        require(!dcl[_dc].approved, "DataCreator is alrady approved");
        dcl[_dc].approved = true;
        emit approveDataCreatorLog(_dc, true);
    }

    function approvePatient(address _p) public onlyOwner {
        require(!pl[_p].approved, "Patient is alrady approved");
        pl[_p].approved = true;
        emit approvePatientLog(_p, true);
    }

    function approveDataRequester(address _dr) public onlyOwner {
        require(!drl[_dr].approved, "DataRequester is alrady approved");
        drl[_dr].approved = true;
        emit approveDataRequesterLog(_dr, true);
    }

    function setupSystemContracts(OracleService _os, DataProfile _dp)
        public
        onlyOwner
    {
        require(address(_os) != address(0) && address(_dp) != address(0));
        os = _os;
        dp = _dp;
        emit setupSystemContractsLog(address(os), address(dp));
    }

    function setDataCreatorInfo(
        address _dataCreatoraWalletAddress,
        bytes calldata _oracleServiceServer
    ) external {
        dcl[msg.sender].walletAddress = _dataCreatoraWalletAddress;
        dcl[msg.sender].contractAddress = msg.sender;
        dcl[msg.sender].oracleServiceServer = _oracleServiceServer;

        emit setDataCreatorInfoLog(
            msg.sender,
            _dataCreatoraWalletAddress,
            _oracleServiceServer,
            address(this)
        );
    }

    function setPatientInfo(address _patientWalletAddress) external {
        pl[msg.sender].walletAddress = _patientWalletAddress;
        pl[msg.sender].contractAddress = msg.sender;

        emit setPatientInfoLog(msg.sender, _patientWalletAddress);
    }

    function setDataRequesterInfo(
        address _dataRequesterWalletAddress,
        bytes memory _publicKeyIpfsRef,
        bytes32 _role
    ) public {
        drl[msg.sender].walletAddress = _dataRequesterWalletAddress;
        drl[msg.sender].contractAddress = msg.sender;
        drl[msg.sender].publicKeyIpfsRef = _publicKeyIpfsRef;
        drl[msg.sender].role = _role;

        emit setDataRequesterInfoLog(
            msg.sender,
            _dataRequesterWalletAddress,
            _publicKeyIpfsRef,
            _role
        );
    }

    function getDataRequesterInfo(address _dataRequesterContract)
        public
        view
        returns (bytes memory _publicKeyIpfsRef, bytes32 _role)
    {
        _publicKeyIpfsRef = drl[_dataRequesterContract].publicKeyIpfsRef;
        _role = drl[_dataRequesterContract].role;
    }

    function updateDataRequesterPublicKey(bytes memory _publicKeyIpfsRef)
        public
    {
        require(
            drl[msg.sender].contractAddress == msg.sender,
            "Only DataRequester contract can call this function"
        );
        require(
            keccak256(drl[msg.sender].publicKeyIpfsRef) !=
                keccak256(_publicKeyIpfsRef),
            "Public key is exist"
        );

        drl[msg.sender].publicKeyIpfsRef = _publicKeyIpfsRef;

        emit updateDataRequesterPublicKeyLog(drl[msg.sender].publicKeyIpfsRef);
    }

    function updateOracleServiceServer(bytes memory _oracleServiceServer)
        public
    {
        require(
            dcl[msg.sender].contractAddress == msg.sender,
            "Only DataCreator contract can call this function"
        );

        require(
            keccak256(dcl[msg.sender].oracleServiceServer) !=
                keccak256(_oracleServiceServer),
            "Oracle Service Server address is exist"
        );

        dcl[msg.sender].oracleServiceServer = _oracleServiceServer;

        emit updateOracleServiceServerLog(dcl[msg.sender].oracleServiceServer);
    }
}
